import React from 'react';
import { Link } from 'react-router-dom';
//import '../App.css';


const userCard = (props) => {
    const  user  = props.user;

    return(
        <div className="card-container">
            <div className="desc">
                <h2>
                    <Link to={`/show-user/${user._id}`}>
                        { user.name }
                    </Link>
                </h2>
                <h3>{user.email}</h3>
                <p>{user.date}</p>
            </div>
        </div>
    )
};

export default userCard;
